import './card.component.scss'

export default function Card(result) {
    const{gender}=result
    return (
        <div className='card-container'>
            <p className='p-gender'>Male</p>
            <p className='p-name'>Ms Smita Parkhi</p>
            <p className='p-email'>Email.id@emil.com</p>
        </div>
    )
}
